              </div>
            </div>
          </div>
        </div>
      </div>
    );    
  }

}

export default Main;


const MenuList = ({ list }) => (
  <Menu>
    {list.map(menuItem => (
      <a id={menuItem.id} className="menu-item" href="/">{menuItem.title}</a>
